export const createConsoleLogger = (level = 'debug') => ({
    logInit: (message) => {
        console[level]('Initialize', message);
    },
    logIncoming: (message) => {
        console[level]('Received message', message);
    },
    logOutcoming: (message) => {
        console[level]('Sended message', message);
    },
});
